import React from 'react';
import './ResultsDisplay.css'

const ResultsDisplay = ({results}) => {
    return (
        <div>
            <p>Hi</p>
            {results.foreach((element, index) => {
                return <p>{element}</p>
            })}
        </div>
    );
}

export default ResultsDisplay;
